import React from 'react';

class ShowReminders extends React.Component {
    constructor() {
      super();
    }
    render () {
        console.log(this.state.reminders)
        return (
          <div>  <h2>Reminders</h2>
            <ul>
              {this.state.reminders.map(reminder => <li key={reminder.name}>{this.props.reminder.timestamp} {this.props.reminder.name}</li>)}
            </ul>
          </div>
      )
    }
  }

export default ShowReminders

